import React, { useEffect, useState } from 'react';
import {useNavigate} from 'react-router-dom';
import DeleteUser from './DeleteUser';

const AdminUsersWithAccounts = () => {
  const [usersWithAccounts, setUsersWithAccounts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
      const fetchUsersWithAccounts = async () => {
          try {
              const response = await fetch('/admin/users-with-accounts');

              if (response.ok) {
                  const data = await response.json();
                  setUsersWithAccounts(data);
              } else {
                  setError('Failed to fetch users with accounts.');
              }
          } catch (error) {
              setError('Error fetching users with accounts.');
          } finally {
              setLoading(false);
          }
      };

      fetchUsersWithAccounts();
  }, []);

  return (
      <div>
          <h1>Admin Users with Accounts</h1>

          {loading && <p>Loading...</p>}
          {error && <p style={{ color: 'red' }}>{error}</p>}

          {usersWithAccounts.map((user) => (
              <div key={user.id}>
                  <h2>Username: {user.username}</h2>
                  <p>Email: {user.email}</p>

                  {user.accounts.map((account) => (
                      <div key={account.id}>
                          <p>Account Name: {account.account_name}</p>
                          <p>Balance: ${account.balance}</p>
                      </div>
                  ))}

                  <hr />
              </div>
          ))}
      </div>
  );
};


export default AdminDashboard;
